import React from 'react';
import Style from './StartModal.module.css';
import { Button } from '@mui/material';

const StartModal = (startClick) => {
  return (
    <div className={Style.modal}>
        <div className={Style.modal_inner}>
            <h3 className={Style.modal__inner__title}>Welcome!</h3>
            <span className={Style.modal__inner__subtitle}>
                Press "Start" to begin the game!
            </span>
            <Button
                onClick={startClick}
                className={Style.modal__inner__button}
                variant="outlined"
                color="secondary"
                onClick={() => {
                    console.log('clicked');
                }}
            >
                Start
            </Button>
        </div>
    </div>
  )
}

export default StartModal
